// export default RobotFace;


import React from 'react';

function Robot() {
  return (
    <div>
      {/* Robot's head */}
      <div style={{ width: '100px', height: '100px', background: 'gray' }}></div>

      {/* Robot's body */}
      <div style={{ width: '100px', height: '150px', background: 'silver' }}></div>

      {/* Robot's arms */}
      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <div style={{ width: '50px', height: '100px', background: 'gray' }}></div>
        <div style={{ width: '50px', height: '100px', background: 'gray' }}></div>
      </div>

      {/* Robot's legs */}
      <div style={{ display: 'flex', justifyContent: 'space-between' }}>
        <div style={{ width: '50px', height: '100px', background: 'silver' }}></div>
        <div style={{ width: '50px', height: '100px', background: 'silver' }}></div>
      </div>
    </div>
  );
}

export default Robot;
